import React from "react";
import Styles from "./UI/styles.module.css";

export function AuthWindow() {
	return(
		<div className = {Styles.container}>
				<form id="formAuth" className = {Styles.form}>
					<label htmlFor="formAuth">Авторизация</label>
				</form>
		</div>
	);
}
